import React, { useEffect, useState } from "react";
import { IProducts } from "../Products/Models/IProducts";
import ProductsService from "../Products/Services/ProductsService";


interface IProps{}
interface IState{}

let ProductList:React.FC<IProps> =() =>{

    let [product , setProduct] = useState<IProducts[]>([] as IProducts[]);
    let [loading , setLoading] = useState<boolean>(false);
    let [errorMessage ,setErrorMessage] = useState<string>("");
    useEffect(()=>{
            setLoading(true);
        ProductsService.getAllProducts().then((response)=>{
            setProduct(()=>response.data);
            setLoading(false);
        }).catch((err)=>{
            setErrorMessage(()=>err.message);
            setLoading(false);
        })
    },[])

    return(
        <>
            <div className="grid">
                <div className="container">
                    <div className="row m-3">
                        <div className="col">
                            <div className="">
                                <div className="">
                                    <table className="table table-hover">
                                        <thead>
                                            <tr>
                                            <th>SNO</th>
                                            <th>Product</th>
                                            <th>Name</th>
                                            <th>Price</th>
                                            <th>Qty</th>
                                            <th>Actions</th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            {
                                                product.map((products)=>{
                                                    return(
                                                        <tr>
                                                            <td>{products.sno}</td>
                                                            <td><img height={100} width={100} src={products.imageUrl} alt="No Image" /></td>
                                                            <td>{products.name}</td>
                                                            <td>{products.qty}</td>
                                                            <td>{products.price}</td>
                                                            <td>{products.info}</td>
                                                        </tr>
                                                    )
                                                })
                                            }
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );

}

export default ProductList;
